// Open source SVG data from svgrepo.com

import React from 'react';

export const CartIcon = ({ setToggleCart, toggleCart }) => (
  <svg
    onClick={() => {
        //setToggleCart((prevState) => !prevState);
        setToggleCart(!toggleCart);
    }}
    width='14'
    height='14'
    viewBox='0 0 14 14'
    fill='none'

  >
    <path
      d='M7 0C3.13438 0 0 3.13438 0 7C0 10.8656 3.13438 14 7 14C10.8656 14 14 10.8656 14 7C14 3.13438 10.8656 0 7 0ZM11 7.5H7.5V11H6.5V7.5H3V6.5H6.5V3H7.5V6.5H11V7.5Z'
      fill='black'
      fillOpacity='0.66'
    />
  </svg>
);
